class Product {
    constructor(name, price, number, origin, money, image) {
        this.name = name;
        this.price = price;
        this.number = number;
        this.origin = origin;
        this.money = money;
        this.image=image;
    }

}

let products = [
    new Product("Nhãn lồng", 20000, 20, "Hưng Yên",'','data:image/jpeg;base64,'),
    new Product("Vải thiều", 30000, 50, "Bắc Giang",'','data:image/jpeg;base64,'),
    new Product("Dừa sáp", 150000, 25, "Bến Tre",'','data:image/jpeg;base64,'),
    new Product("Chè búp", 35000, 50, "Thái Nguyên",'','data:image/jpeg;base64,'),
    new Product("Cam sành", 40000, 40, "Hà Giang",'','data:image/jpeg;base64,'),
    new Product("Nhỏ đỏ", 55000, 60, "Ninh Thuận",'','data:image/jpeg;base64,'),
    new Product("Chuối sáp", 40000, 70, "Bến Tre",'','data:image/jpeg;base64,')
];

function showAllProduct() {
    let content = "<table border=\"\">\n" +
        "  <tr>\n" +
        "    <th>Tên nông sản</th>\n" +
        "    <th>Giá nông sản</th>\n" +
        "    <th>Số lượng</th>\n" +
        "    <th>Xuất xứ</th>\n" +
        "    <th>Hình ảnh</th>\n" +
        "    <th>Thanh toán</th>\n" +
        "    <th>Thành tiền</th>\n" +
        "    <th>Sửa</th>\n" +
        "    <th>Xóa</th>\n" +
        "  </tr>";
    for (let i = 0; i < products.length; i++) {
        let temp = "<tr>" +
            "      <td>" + products[i].name + "</td>" +
            "      <td>" + products[i].price.toLocaleString('vi-VN',{style:'currency',currency:'VND'}) + "</td>" +
            "      <td>" + products[i].number + "</td>" +
            "      <td>" + products[i].origin + "</td>" +
            "      <td class='td_ha'><img src='"+products[i].image+"' class='img1'></td>" +
            "      <td style='width: 100px;height: 80px'><button class='btn_tt' onclick='getPay(" + i + ")'>Thanh toán</button></td>" +
            "      <td>" + products[i].money.toLocaleString('vi-VN',{style:'currency',currency:'VND'})
            + "</td>" +
            "      <td style='width: 100px;height: 80px'><button class='btn_sua' onclick='editProduct(" + i + ")'>Sửa</button></td>" +
            "      <td style='width: 100px;height: 80px'><button class='btn_xoa' onclick='deleteProduct(" + i + ")'>Xóa</button></td>" +
            "    </tr>";
        content += temp;
    }

    content += "</table>";
    document.getElementById("content").innerHTML = content;
}

showAllProduct();

function getPay(index) {
    let newNum = prompt("Nhập số lượng mua", products[index].number);
    if (newNum > products[index].number) {
        alert('Không đủ số lượng hàng bạn cần mua!!!');
        alert('Mời nhập lại số lượng mua!!!');
    } else {
        let a = newNum * products[index].price;
        products[index].money = a;
        products[index].number = products[index].number - newNum;
    }
    showAllProduct();
}
